    "10": {
      "ES": {
        "titol": "Amor tan grande",
        "audio": null,
        "estat": null,
        "cansoner": {
          "nom": "blau",
          "numero": 155
        },
        "lletra": [
          {
            "tipus": "estrofa",
            "paragraf": [
              "Amor tan grande",
              "profundo y sublime",
              "es el amor de mi Creador.",
              "• No hay nada en el mundo",
              "que pueda igualarse",
              "al tierno amor",
              "de mi buen Jesús.",
              "Dios de amor, oh Dios de amor",
              "sólo eres Tú el Dios de amor",
              "no hay otro Dios fuera de Ti",
              "fuera de ti",
              "para mí no hay amor."
            ]
          },
          {
            "tipus": "estrofa",
            "paragraf": [
              "• Él solo nos ama",
              "nos comprende",
              "y nos guarda",
              "de todos los males",
              "que existen aquí.",
              "• Por eso le adoro",
              "con toda mi alma",
              "porque nos ha dado",
              "el Señor dulce calma."
            ]
          }
        ]
      }
    },
